// src/pages/HistoricoConsultas.js

import React from 'react';
import { Table } from 'react-bootstrap';

function HistoricoConsultas({ consultas }) {
  return (
    <div>
      <h3>Histórico de Consultas</h3>
      {consultas.length === 0 ? (
        <p>Você ainda não tem consultas registradas.</p>
      ) : (
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Data da Consulta</th>
              <th>Hora</th>
              <th>Médico</th>
              <th>Motivo</th>
            </tr>
          </thead>
          <tbody>
            {consultas.map((consulta, index) => (
              <tr key={index}>
                <td>{consulta.data}</td>
                <td>{consulta.hora}</td>
                <td>{consulta.medico}</td>
                <td>{consulta.motivo}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      )}
    </div>
  );
}

export default HistoricoConsultas;
